    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2530432","type":"CustomJS"},{"attributes":{"coordinates":null,"formatter":{"id":"2530468"},"group":null,"major_label_policy":{"id":"2530469"},"ticker":{"id":"2530276"},"visible":false},"id":"2530275","type":"LinearAxis"},{"attributes":{},"id":"2530468","type":"BasicTickFormatter"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"2530368"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":null},"top":{"field":"Open"},"width":{"field":"_width"},"x":{"field":"index"}},"id":"2530372","type":"VBar"},{"attributes":{},"id":"2530280","type":"BasicTicker"},{"attributes":{"data":{"Close":{"__ndarray__":"ATCeQUNPP0A9YYkHlOE+QC7JAbuaxD5A6Nztemn6PkCwcJLmj6U+QCLeOv92PT1Ac4V3uYg/PUC5bd+j/mo9QFouG53zSz1ARdREn48iPUCLTpZa7w89QI+JlGbzyDtAixpMw/AhPECVRzfCojY8QCzzVl2HqjxASrVPx2OmPEAYmYBfI4E8QOXuc3y0ODxAOne7Xpq+O0ANVMa/z8Q7QNEGYAMi7DtADVTGv8/EO0CthsQ9loI7QPMAFvn1bztAZwxzgjaVO0DTLTvEP5w5QCRfCaTEIjpAnQ35ZwbdOkBm9KPhlO06QF1txf6yoztAMLyS5LmGO0Agls0ckkY7QDC8kuS5hjtAigJ9Ik96O0AwvJLkuYY7QPUUOUTceDxAT3eeeM6yPEAixmte1ZU8QHOFd7mIPz1AICQLmMBpO0Ck42pkV/I7QA72Jobk8DxAiPccWI4QPkB9yjFZ3Ps9QOwvuycPWz5Ac51GWirnPUAAcsKE0dw9QJZ31QPmhT1ABeEKKNSDPUCRuTKoNhg9QLlt36P+aj1ApaFGIclk
